class Timer{constructor(){this.clockList=[],this.runControl=window.setInterval(()=>{this.Run()},1e3),console.log("\uD83D\uDD52 Ready")}Export(){return this.clockList}Import(a=[]){this.clockList=this.clockList.concat(a)}Create(a=!1){let b=new Date,c=10>b.getDate()?"0"+b.getDate():b.getDate(),d=10>b.getMonth()+1?"0"+(b.getMonth()+1):b.getMonth()+1,e={created:b.getFullYear()+"-"+d+"-"+c,seconds:0,getTime:function(){const a=Math.floor(this.seconds/60%60),b=Math.floor(this.seconds/3600),c=this.seconds%60;return{seconds:c,minutes:a,hours:b}},id:Date.now(),active:a,reset:function(){this.seconds=0},tick:null};return this.clockList.push(e),this.clockList[this.clockList.length-1]}Run(){for(let a=0;a<this.clockList.length;a++)!0===this.clockList[a].active&&(this.clockList[a].seconds++,"function"==typeof this.clockList[a].tick&&this.clockList[a].tick(this.clockList[a].getTime()))}}